MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "CalibrenmOPC is a full-chip batch OPC tool that corrects potential distortions on a mask input layer introduced by the optical and resist processes. ");
MGCAddSnippet(5, "The Calibre nmOPC tool provides several extensions and enhancements to Calibre OPCpro technology that are geared for the challenges implicit in the 65 nm technology nodes and below.");
MGCAddSnippet(6, "The Compact Model 1 (CM1) resist model has been specifically developed for use with Calibre nmOPC. The Calibre nmOPC tool takes advantage of the data available for resist simulation with a dense simulation engine.");
MGCAddSnippet(7, "Variable Etch Bias (VEB) can be used as a modeling step to separately account for etch effects. ");
MGCAddSnippet(8, "Flare effects are a significant concern for extreme ultraviolet (EUV) lithography. Flare in EUV lithography is a random effect caused by light scattering due to optics surface roughness and defects in the multilayered optical surfaces.");
MGCAddSnippet(9, "Calibre mpOPC is designed for double and multiple mask scenarios where a layout can be split into separate masks for correction, and then  stitched  back together by overlapping the split masks. Calibre nmOPC provides the ability to correct for mask-to-mask issues, such as bridging or a lack of proper overlapping between masks, ensuring that the stitching process will succeed.");
MGCAddSnippet(10, "Some Calibre nmOPC commands can make measurements on a layout and save the values in a tag set. These values can be passed to the layout using the Calibre OPCverify property mechanism. There are some additional limitations, however.");
MGCAddSnippet(11, "Calibre nmOPC is intended for use at 65 nm and below. Depending on layer critical dimensions and pattern density, Calibre nmOPC will provide faster run times for critical layers than Calibre OPCpro due to the computational efficiencies inherent in performing dense over sparse simulations. ");
MGCAddSnippet(12, "Calibre nmOPC is fully integrated with the complete set of Calibre RET tools. Calibre nmOPC and Calibre OPCverify provide dense OPC and OPC verification capabilities in an integrated flow. Together with CalibrenmDRC, CalibreOPCsbar, and CalibreFRACTURE, a complete hierarchical post-tapeout flow can be built on the Calibre platform. ");
MGCAddSnippet(13, "Calibre nmOPC corrects for potential distortions introduced by the optical and resist processes through an iterative process. It repeats the process until the printed image closely approximates the original layout. ");
MGCAddSnippet(14, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(15, "Calibre nmOPC can be utilized quickly using some basic processes, including the creation of a minimum setup file.");
MGCAddSnippet(16, "If you intend to run Calibre nmOPC, you should be familiar with Calibre nmDRC and Calibre OPCverify procedures. An understanding of programming SVRF and TVF rule files is very useful. ");
MGCAddSnippet(17, "You run Calibre nmOPC as a batch run using the Calibre Hierarchical Engine. ");
MGCAddSnippet(18, "If you wish to implement a flow that accounts for the VEB model, there is a particular process to follow in creating a Calibre nmOPC setup file.");
MGCAddSnippet(19, "You can add Calibre OPCverify commands that work on setlayer image commands in a Calibre nmOPC setup file. For Calibre nmOPC, this means that you can combine Calibre nmOPC and Calibre OPCverify verification in a single setup file.");
MGCAddSnippet(20, "Setup files for Calibre nmOPC vary from simple (leveraging the built-in algorithms to streamline corrections) to extremely complex (defining custom correction recipes based on the dense simulations). ");
MGCAddSnippet(21, "In the Calibre nmOPC setup file, you control how simulations are performed, how corrections are applied, and any post processing or verification required.");
MGCAddSnippet(22, "In the SVRF rule file, you control what and how the Calibre Hierarchical Engine reads layer data in from the original layout database and writes results out to the results database. In addition, you use SVRF commands to perform pre- and post-processing on the Calibre nmOPC data and to invoke Calibre nmOPC.");
MGCAddSnippet(23, "Edge placement error (EPE) is the difference between the drawn edge of a polygon and either the simulated silicon edge or actual silicon edge when printed. Sampling EPE for simulation in OPC is one of the most important factors in getting accurate output.");
MGCAddSnippet(24, "The Calibre nmOPC tool uses the simulated EPE values to calculate how far to move an edge.");
MGCAddSnippet(25, "Calibre nmOPC supports a Tcl-based scripting language that provides a highly customizable environment for Calibre nmOPC with a Tcl interface. ");
MGCAddSnippet(26, "The setup file for Calibre nmOPC can contain any of the variables, keywords, or commands described in this document.");
MGCAddSnippet(27, "Calibre nmOPC is primarily run in batch mode, invoked from a shell tool command line. Calibre nmOPC can also be run on small sections of layout from within Calibre WORKbench.");
MGCAddSnippet(28, "Calibre nmOPC can be run on the CalibreFullScale platform. However, there are some limitations.");
MGCAddSnippet(29, "This manual uses several acronyms and terms to refer to product features or technical processes.");
MGCAddSnippet(30, "Calibre nmOPC is configured primarily through the setup file. The setup file contains all the key operations to correct lithographic errors in your layout file.");
MGCAddSnippet(31, "One of the main steps in using Calibre nmOPC is to import model information into your setup file.");
MGCAddSnippet(32, "One of the methods to load models is through a set of Calibre nmOPC setup file commands.");
MGCAddSnippet(33, "An alternative method to load model information (as well as mask information) is using a litho model. ");
MGCAddSnippet(34, "Extreme ultraviolet (EUV) lithography models are an alternative to deep ultraviolet (DUV) models more commonly used for optical models. An EUV system uses a much lower wavelength (in the 13.5 nm range, which is about a 10x reduction in wavelength) compared to a standard DUV system. At this wavelength, optics must be all-reflective, and therefore two new effect characteristics must be accounted for:");
MGCAddSnippet(35, "Topography modeling methodology, for specific processes, is aware that the composition of underlying layers can significantly influence OPC results. In particular, the materials stacked on top of the silicon wafer up to the resist-air interface (also known as a  film stack ) are dependent on X and Y coordinates laterally across the wafer, where the resist stack is non-uniform across the wafer. ");
MGCAddSnippet(36, "You must define layers in the Calibre nmOPC setup file.");
MGCAddSnippet(37, "Each layer passed from LITHO DENSEOPC as input must have a  layer  statement. Any minimum setup file will map input layers from SVRF to simulation names.");
MGCAddSnippet(38, "Layers passed to OPC are defined within a denseopc_options block. All layers passed on the denseopc setlayer command line must be defined. The number of layers passed must equal the number defined.");
MGCAddSnippet(39, "To generate output layers, use the setlayer command in the setup file.");
MGCAddSnippet(40, "Layers are used for a number of different purposes in Calibre RET, depending on the specific type. ");
MGCAddSnippet(41, "You can define an imaging background in the Calibre nmOPC setup file.");
MGCAddSnippet(42, "You must define an image in the Calibre nmOPC setup file.");
MGCAddSnippet(43, "There are a number of additional optional operations that can be performed from the Calibre nmOPC setup file.");
MGCAddSnippet(44, "There are different correction methods using Calibre nmOPC.");
MGCAddSnippet(45, "There are two methods to set up automatic fragmentation, fully automatic fragmentation or through user specification.");
MGCAddSnippet(46, "You can create custom fragmentation schemes using commands supported in the Calibre nmOPC setup file. These custom schemes will entirely replace the default automatic fragmentation behavior. Note that once you use any custom fragmentation scheme, automatic fragmentation no longer occurs.");
MGCAddSnippet(47, "You can define mask rule constraints in the Calibre nmOPC setup file.");
MGCAddSnippet(48, "You must define process windows in the Calibre nmOPC setup file.");
MGCAddSnippet(49, "When using the pw_condition command to implement process window-based OPC (or PWOPC), the recommended method of implementation for most cases is called PV Band PWOPC. This method uses physical verification bands (also known as PV bands) that are simulated using different process window conditions. This method has several key advantages.");
MGCAddSnippet(50, "Direct etch effect correction is a method of using both a Variable Etch Bias (VEB) litho model along with Process Window OPC (PWOPC) to correct a target. More specifically, you can correct etch effects on a target directly using VEB-based process windows.");
MGCAddSnippet(51, "Resist top loss is a source of wafer failure in advanced technology nodes. ");
MGCAddSnippet(52, "You can check enclosure with image cost functions in Calibre nmOPC.");
MGCAddSnippet(53, "You can define  No OPC  regions in Calibre nmOPC.");
MGCAddSnippet(54, "You can smooth biasing on target layers in Calibre nmOPC in the setup file.");
MGCAddSnippet(55, "You can make adjustments for corner rounding during the OPC process in the setup file.");
MGCAddSnippet(56, "Calibre OPCverify has the ability to generate images based on layers created using the setlayer command. For Calibre nmOPC, this means that you can combine Calibre nmOPC correction and Calibre OPCverify verification in a single setup file.");
MGCAddSnippet(57, "You can augment or even replace Calibre nmOPC fragmentation schemes by creating a custom Tcl script. Calibre nmOPC supports a Tcl-based scripting language that provides a customizable environment for Calibre nmOPC with a Tcl interface. ");
MGCAddSnippet(58, "Sub-Resolution Assist Features (SRAFs) are shapes (such as scattering bars) introduced to the mask specifically to enhance the lithographic resolution of the layout on the wafer. As SRAFs do not represent actual design polygons, they are not meant to be printed. ");
MGCAddSnippet(59, "At the end of each Dense OPC run, a transcript is produced. This transcript contains information that can be useful in analyzing the overall performance of the OPC run. ");
MGCAddSnippet(60, "Calibre nmOPC is configured through a series of batch script commands in a setup file.");
MGCAddSnippet(61, "The following sections collect some special purpose commands by functionality. The list is not exhaustive.");
