MGCAddSnippet(183, "The litho model consolidates all of the model and mask information into a single object in order to define a manufacturing technology configuration. It is intended to unify simulation conditions across Calibre tools to reduce the possibility of errors.");
MGCAddSnippet(184, "Calibre nmOPC supports a Tcl-based scripting language which provides a highly customizable environment for Calibre nmOPC with a Tcl interface. ");
MGCAddSnippet(185, "The Tcl-based script can be placed anywhere within a denseopc_options block. This allows for the script to be precompiled and checked for errors at parse time, and may enable a better controlled run time (the Tcl script becomes a string of valid Calibre nmOPC script commands, so there is no user Tcl code being executed per tile, at run time).");
MGCAddSnippet(186, "Variables in Calibre nmOPC custom scripting are defined by the VARIABLE SVRF command and passed in. ");
MGCAddSnippet(187, "Calibre nmOPC scripts can create multiple output layers. These layers can serve a number of different purposes, including:");
MGCAddSnippet(188, "Once you fragment a polygon, you may only wish to target minor adjustments to certain edges, rather than all fragments. To target those specific fragment edges, you can place unique tags to separate them from the rest of the fragments.");
MGCAddSnippet(189, "In Calibre nmOPC, the NEWTAG command is used to create new tag sets. ");
MGCAddSnippet(190, "Output from a NEWTAG operation is a unique name that refers to a set of fragments or edges. To reference a tag set:");
MGCAddSnippet(191, "Once you have created your tags, you can control the effect the RET tools have on the tagged edges.");
MGCAddSnippet(192, "As the tagging script is Tcl-based, the variables that hold tag sets are passed by name into functions that use tag sets. This eliminates the need to use large numbers of $tagname references in the code, but can cause unusual behavior when passing tag sets into processes.");
MGCAddSnippet(193, "Tagging is only supported for the opc or correction layers, thus tagging visible layers directly will generate an error. However, as layers can be specified in the tag-based MRC rules, you can effectively specify a visible layer using this method. This is the correct way to achieve MRC rules between tags that are not on the same layer (for example, an opc feature and an sraf layer).");
MGCAddSnippet(194, "There are a number of tagging-related commands legal for Calibre nmOPC Tcl-based custom scripting.");
MGCAddSnippet(195, "You can create extensions to existing fragmentation schemes as well as create entirely new fragmentation algorithms using the Calibre nmOPC customization script.");
MGCAddSnippet(196, "You can apply different operations to fragments, including measurements, retrieving EPE information, and setting displacements.");
MGCAddSnippet(197, "Create custom measurements for fragment length, distances, EPE, and CD using the Tcl commands. ");
MGCAddSnippet(198, "Calibre nmOPC bases all of its operations on a pixel-based dense simulation grid. Measuring EPE and CDs are performed on a dense simulation of the layout. ");
