MGCAddSnippet(289, "Changes the target value (ideal placement) of specified fragments.");
MGCAddSnippet(290, "Creates a curve from the target based on the settings and moves sites to the new curve.");
MGCAddSnippet(291, "Associates a target function with a function slot.");
MGCAddSnippet(292, "Sets a rule-based fragment displacement.");
MGCAddSnippet(293, "Converts user units into database units.");
MGCAddSnippet(294, "There are a number best practices available when using Calibre nmOPC to correct distortions on a mask input layer introduced by optical and resist processes. ");
MGCAddSnippet(295, "There are a number of recommended settings for Calibre nmOPC setup file commands for better performance and results. ");
MGCAddSnippet(296, "The recommended setup file parameter settings described in the following table are important for creating the fastest possible nmOPC setup file runtime. ");
MGCAddSnippet(297, "There are several different ways that jog quality can affect OPC results. ");
MGCAddSnippet(298, "As jogs introduce corner points (both concave and convex), it changes the way EPEs are measured. ");
MGCAddSnippet(299, "Jogs can be simulated and moved just like any other edge. However, their small size typically means that controlling the EPE on the jog edge is unimportant. Furthermore, moving the jog edges can cause the more critical neighbor edges to be blocked by MRC constraints.");
MGCAddSnippet(300, "The Calibre nmOPC Process Window OPC (PWOPC) capability is available to improve the litho process window. Process Window OPC is used to reduce the risk of critical failures due to a number of process variations.");
MGCAddSnippet(301, "When using the pw_condition command to implement process window-based OPC (or PWOPC), use PV Band PWOPC. This method uses physical verification bands that are simulated using different process window conditions. This method has several key advantages.");
MGCAddSnippet(302, "For minimum CD control, a pair of sites are created for minimum CD evaluation. CD evaluation sites are only created on the location where the target CD (not contour CD) is within the range of minimum CD +/-Nyquist value.");
MGCAddSnippet(303, "One recommendation is to output violation tags.");
MGCAddSnippet(304, "The number of process window iterations has the largest impact on the PV Band PWOPC runtime. In general, the initial recommendation is to use a 50/50 ratio between non-process window and process window iterations settings, ranging down to a ratio of 3/12 (no-PW/PW) for good quality of results.");
MGCAddSnippet(305, "The second most important factor that has a direct impact on PWOPC speed is the number of PW conditions. The more conditions that are specified, the slower the PWOPC run. Although some of the calculations in PV Band PWOPC case are concurrent, the impact of adding several conditions is significant.");
MGCAddSnippet(306, "In order to make general improvements to the run time of the PV Band PWOPC, try switching to an alternative simulator settings simulation_consistency keyword. This makes use of several enhancements to the simulation engine.");
MGCAddSnippet(307, "There are several more recommendations that can affect the performance of process window-based OPC.");
MGCAddSnippet(308, "For applications where enclosure of another layer (such as M1 enclosure of contacts and vias) is critical, use the wafer_enclose command. For example:");
MGCAddSnippet(309, "If you encounter an OPC violation for your process window, check for the following:");
MGCAddSnippet(310, "The setlayer curve command allows you to create a  smoothed  target based on the original target. The smoothed target allows you to prevent overcorrection on 2D and jogs. The setlayer curve command implements a B-spline, and control points are derived from existing polygon vertices.");
MGCAddSnippet(311, "Use the retarget_layer  emulate  option with the generated curve layer. This helps reduce ripples near corners especially at concave corners. The setlayer curve produces a more realistic target, which often results in less aggressive corner correction. However, you must still carefully tune your fragmentation and OPC recipes. ");
MGCAddSnippet(312, "There are a number of recommended settings for setup file commands.");
MGCAddSnippet(313, "The selection of tile size is critical for obtaining optimum turn-around-time in full chip OPC runs. If the tile size is too large, the remote memory consumption (in MTflex runs) can be so high that the remote CPU could go into swap (with large impact on run time). If the tile size is too small, more memory on the primary host is consumed, with a similar negative impact on performance.");
MGCAddSnippet(314, "There are a number of recommendations for the Calibre nmOPC setup file to obtain better results.");
MGCAddSnippet(315, "The mrc_rule command block allows you to specify external/internal constraint checks between layers based on the distance between fragments as well as fragment length. ");
MGCAddSnippet(316, "Fragmentation has a large impact on the consistency of corrections performed during an OPC run. There are a number of best practices that can be used to improving fragmentation for better consistency.");
MGCAddSnippet(317, "In the case illustrated in the following figure, the 15 micron long edge trapped between the convex and concave corners is crossing the tile boundary.");
MGCAddSnippet(318, "Optimizing fragmentation for long edges reduces simulation run time. In the case of asymmetric intrafeature fragmentation for long edges, there are methods of getting better consistency. ");
MGCAddSnippet(319, "To manage fragmentation consistency around tile boundaries there are a number of best practices to be applied to fragment_inter statements.");
MGCAddSnippet(320, "Optimizing fragmentation for short edges improves simulation results. For asymmetric intrafeature fragmentation for short edges, there are methods of getting better consistency. ");
MGCAddSnippet(321, "The fragment_inter command can introduce asymmetric results under some conditions. ");
MGCAddSnippet(322, "Jogs impact the fragmentation and correction consistency. ");
MGCAddSnippet(323, "Different layer types can be optimized to produce better results. There are several practices and recommendations available for these layers.");
MGCAddSnippet(324, "When building a POLY or ACTIVE layer in an OPC recipe, there are several issues to consider.");
MGCAddSnippet(325, "When building a contact layer in an OPC recipe, there are several issues to consider.");
MGCAddSnippet(326, "There can be occasions where inconsistencies in Calibre nmOPC output occur. ");
MGCAddSnippet(327, "There are several different ways to improve the results of your etch-based OPC runs. ");
MGCAddSnippet(328, "When setting up the VEB setup file, keep it simple and use automatic fragmentation as a starting point. ");
MGCAddSnippet(329, "Use the etch_imagegrid command to set the etch image grid to 10 nm.");
MGCAddSnippet(330, "When determining how many OPC iterations must be performed, you must have enough iterations for the recipe to converge. This essentially means that the output layer no longer changes with increasing iterations. You can perform a simple convergence analysis by plotting the output resist target plus the etch contour (veb_simulate) versus iterations. ");
MGCAddSnippet(331, "You can use the Tcl-based custom scripting capability of Calibre nmOPC to perform a number of different optimizations.");
MGCAddSnippet(332, "The feedback command defines the default feedback values to be used per iteration. Edge movement is set by (EPE * feedback). If there is no valid EPE, edge movement is set to a default of Nyquist/3.");
MGCAddSnippet(333, "In some situations, reaching good convergence means using an  unrealistic  resist target space/width. An  unrealistic  target in this case means that the output from the VEB correction step (the resist target) is either too narrow or very closely spaced and would typically fail during lithography. For example, you can have an etch bias from a VEB model that is very large, leading to a resist target that has a very narrow process window. ");
MGCAddSnippet(334, "When corner rounding occurs, it tends to favor optical characteristics and not etch characteristics.");
MGCAddSnippet(335, "The notchfill operation should not be done after setlayer veb_retarget. Using notchfill inside the VEB setup file after the VEB retargeting process can introduce potential MRC violations after OPC.");
MGCAddSnippet(336, "The sraf_print_avoidance command is designed to detect and correct for any printing occurring around sub-resolution assist features (SRAFs). ");
MGCAddSnippet(337, "The most important recommendation is to treat the sraf layer with the attention to detail as you would with the OPC layer. ");
MGCAddSnippet(338, "The asraf layer specifies layers used for negative SRAFs and allows modification of them by SRAF print avoidance. ");
MGCAddSnippet(339, "In general, a careful study of EPE must be done to ensure proper SRAF printing elimination as well as good convergence of the main features. ");
MGCAddSnippet(340, "Careful practices applied to fragmentation of SRAFs improve SRAF results.");
MGCAddSnippet(341, "There are a number of issues to consider when using SRAFs and MRC rules.");
MGCAddSnippet(342, "In order to use sraf_print_avoidance correctly, you must have wafer-level data specifying at which condition SRAF printing is occurring.");
MGCAddSnippet(343, "Use the pw_condition command to define process windows at which SRAF printing occurs. ");
MGCAddSnippet(344, "Calibre mpOPC is used for double and multi-pattern mask correction. This is implemented in a standard Calibre nmOPC setup file using the mpopc command. Double- and triple-patterning significantly increases the complexity of the setup file because you are required to define fragmentation and MRC constraints for every pattern. Often, the fragmentation and constraints are the same for every pattern, but they are still explicitly defined for each combination of patterns. ");
MGCAddSnippet(345, "Variable Etch Bias (VEB) is a process that allows you to separately account for etch effects. This methodology differs from previous OPC practices, where modeling effects including optical, resist, and etch are calculated at the end, using only the post-etch target data.");
MGCAddSnippet(346, "Using VEB to separate out the post-etch data and using it to retarget the design has a number of key benefits.");
MGCAddSnippet(347, "VEB has a number of requirements in order to perform Calibre nmOPC.");
MGCAddSnippet(348, "VEB model-based retargeting processes produce etch-corrected simulation results.");
MGCAddSnippet(349, "In the initial stage, calibrate your models using a test pattern instead of the layout design.");
MGCAddSnippet(350, "After separating the etch and resist models, use the etch model to retarget your design file. In this case, the Calibre nmOPC veb_retarget operation is used to set the guidelines for fragment movement. ");
MGCAddSnippet(351, "Now that you have a modified design that has been retargeted to account for etch effects, proceed with Calibre nmOPC using only the optical and resist model, since the etch effects have already been corrected.");
MGCAddSnippet(352, "Load the results of the Calibre nmOPC simulations back into Calibre OPCverify to test the corrected design file. ");
MGCAddSnippet(353, "There are a number of commonly-asked questions for the VEB process.");
MGCAddSnippet(354, "Extreme ultraviolet (EUV) processes require some additional keywords be added to the setup files before you can use the EUV models in simulations. In addition, while EUV models can be used in a typical post-tapeout flow with only the keyword changes, there are some additional types of runs you can do to improve overall runtime and file size.");
MGCAddSnippet(355, "Many types of chip designs are being produced on EUV processes. Some of these can still preserve hierarchy.");
MGCAddSnippet(356, "The flare map is a PNG file that when used in conjunction with an EUV litho model specifies the flare as a function of layout position. EUV flare effects are approximated by a convolution with the mask instead of intensity.");
MGCAddSnippet(357, "To determine where hierarchy can be preserved, the layout must be combined with the DDM information and flare map. This step must be run before OPC.");
MGCAddSnippet(358, "The optimize_euv_hdb.out file contains many of the changes you would otherwise need to add manually to an SVRF file.");
MGCAddSnippet(359, "If you have process information in a structured file, you can create a custom parser to pass the information to the litho setup file instead of manually creating individual versions. The parsed values can then be read with TVF.");
MGCAddSnippet(360, "When you use EUV models, the transcript includes some additional information that can help you diagnose setup problems.");
MGCAddSnippet(361, "The Calibre mlOPC license unlocks the machine learning API for use with Calibre nmOPC runs. The machine learning API uses models generated from trained neural nets to reduce OPC runtime with no loss of accuracy.");
MGCAddSnippet(362, "Calibre mlOPC requires a product license and certain files, as well as Calibre version 2018.4 or newer.");
MGCAddSnippet(363, "The first step is to populate a model template with data from a known-good rule file and layout.");
MGCAddSnippet(364, "The trained machine learning model replaces many OPC iterations by providing an initial fragment displacement. This is then tuned with a few standard OPC iterations.");
MGCAddSnippet(365, "");
MGCAddSnippet(366, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

